import React from "react";
import Post from "./Post";
import Loader from "./Loader";

const PostsList = posts => {
  return (
    <>
      {posts.posts ? (
        <div class="card-deck">
          {posts.posts.map(post => (
            <Post key={post.id} />
          ))}
        </div>
      ) : (
        <Loader />
      )}
    </>

